 	return(
 	 <GridItem xs={12} sm={12} md={4}>
          <Card chart>
            <CardHeader color="warning">
            <h4> {props.name} </h4>
            </CardHeader>
            <CardBody>
              <h4 className={classes.cardTitle}>{props.role}</h4>
              <h4 className={classes.cardTitle}>{props.opento}</h4>
            </CardBody>
            <CardFooter chart>
              <div className={classes.stats}>
                <AccessTime />  <Link
                            to={{
                                pathname: "nameschedule",
                                state: {
                                    name: props.name,
                                    cid: props.cid,
                                    cname:props.cname
                                }
                            }}
                        >Schedule Interview</Link>
              </div>
            </CardFooter>
             <CardFooter chart>
              <div className={classes.stats}>
                <AccessTime />  <Link
                            to={{
                                pathname: "results",
                                state: {
                                    name: props.name,
                                    cid: props.cid,
                                    cname:props.cname
                                }
                            }}
                        >View Candidate Results</Link>
              </div>
            </CardFooter>
          </Card>
        </GridItem>
 	)
 }

 export default InterCard
